        <div className='bar-chart'>
            <Bar
            data = {{
                labels:['red', 'blue'],
                datasets: [{
                    label: '# of votesk',
                    data: [1, 2, 3, 4],
                }

                ]
            }}
            height={400}
            width={600}
            />
        </div>
        )
    }
}



